import React, { Component } from 'react';
import navbar from './Navbar.css'

class Navbar extends Component {
    render(){
        return(

            <div className="container-fluid p-0">

            <nav className="navbar navbar-expand-md navbar-dark bg-dark">
            <a className="navbar-brand" href="#"><i class="fas fa-dolly"></i>&nbsp;Rapid Transport&nbsp;</a>
            
            <div className="navbar ml-auto">   
            <a className="navbar-dark"href="#"><i class="fas fa-truck-moving"></i>Quem Somos</a>
            <a className="nav-link"href="#"><i class="far fa-comments"></i>Fale Conosco</a>
              </div>
              </nav> 
        
              <footer className="col-12 p-3 footer">
               <countainer className="container col-12 col-md-4 d-flex justify-content-around">
               <a className="navbar-nav-link" href=""><i class="fab fa-facebook-square"></i></a>
               <a className="navbar-nav-link" href=""><i class="fab fa-linkedin"></i></a>
               <a className="navbar-nav-link" href=""><i class="fab fa-instagram"></i></a>
               <a className="navbar-nav-link" href=""><i class="fab fa-twitter-square"></i></a>
               </countainer>   
               </footer>
               </div>
          )
    }
    
}
export default Navbar;
